import React from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem
} from '@mui/material';

const AddUserDialog = ({ open, onClose, newUser, setNewUser, onAdd }) => (
  <Dialog open={open} onClose={onClose} maxWidth="sm" fullWidth>
    <DialogTitle>Add New User</DialogTitle>
    <DialogContent>
      <TextField fullWidth label="Full Name" margin="normal" value={newUser.name} onChange={(e) => setNewUser({...newUser, name: e.target.value})} />
      <TextField fullWidth label="Email" margin="normal" type="email" value={newUser.email} onChange={(e) => setNewUser({...newUser, email: e.target.value})} />
      {/* Add other form fields */}
    </DialogContent>
    <DialogActions>
      <Button onClick={onClose}>Cancel</Button>
      <Button variant="contained" onClick={onAdd}>Add User</Button>
    </DialogActions>
  </Dialog>
);

export default AddUserDialog;
